import Tables from "./Tables";
import AttatchFile from "./AttatchFile";
import Pictures from "./Pictures";

function IndexBar() {
    return <div className="bottomNav" style={{ height: "52px" }}>
        <Tables />
        <AttatchFile />
        <Pictures />
    </div>
}

export default IndexBar;
